def generate_seq(length:int, init=None):
  if init is None:
    init = []
  else:
    init = [AMINO_INDICES[letter] for letter in init]
  ans = ([START_0, START_1] + init)[-2:]
  for i in range(length):
    weights = _TRANSITIONS[ans[-2], ans[-1]]
    ans.append(np.random.choice(len(weights), p=weights/np.sum(weights)))
  return "".join([AMINOS[i] for i in ans[2:]])
